WITH ws_wh_grouped AS (SELECT ws_order_number FROM web_sales GROUP BY ws_order_number HAVING MIN(ws_warehouse_sk) <> MAX(ws_warehouse_sk)), filtered_ws AS (SELECT ws1.ws_order_number, ws1.ws_ext_ship_cost, ws1.ws_net_profit FROM web_sales ws1 JOIN date_dim ON ws1.ws_ship_date_sk = date_dim.d_date_sk JOIN customer_address ON ws1.ws_ship_addr_sk = customer_address.ca_address_sk JOIN web_site ON ws1.ws_web_site_sk = web_site.web_site_sk WHERE date_dim.d_date BETWEEN CAST('1999-2-01' AS DATE) AND (CAST('1999-2-01' AS DATE) + INTERVAL 60 DAY) AND customer_address.ca_state = 'NC' AND web_site.web_company_name = 'pri'), semi_join1 AS (SELECT filtered_ws.ws_order_number, filtered_ws.ws_ext_ship_cost, filtered_ws.ws_net_profit FROM filtered_ws WHERE filtered_ws.ws_order_number IN (SELECT ws_order_number FROM ws_wh_grouped)), semi_join2 AS (SELECT semi_join1.ws_order_number, semi_join1.ws_ext_ship_cost, semi_join1.ws_net_profit FROM semi_join1 WHERE semi_join1.ws_order_number IN (SELECT wr_order_number FROM web_returns WHERE wr_order_number IN (SELECT ws_order_number FROM ws_wh_grouped))) SELECT COUNT(DISTINCT ws_order_number) AS "order count", SUM(ws_ext_ship_cost) AS "total shipping cost", SUM(ws_net_profit) AS "total net profit" FROM semi_join2 ORDER BY COUNT(DISTINCT ws_order_number) LIMIT 100